	add("cybermedia", "{\"term\":\"cybermedia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|media|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Media published on the Internet or in cyberspace\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Peter M Burns, \u0027An Introduction to Tourism and Anthropology\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anthropology is about people: increasingly the relationships between people are framed by global influences including advertising and \u0027\u0027cybermedia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, William B Gudykunst, \u0027Communication Yearbook\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A number of studies have charted the use of \u0027\u0027cybermedia\u0027\u0027 in political campaigns and government in the United States and elsewhere\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Robert M Fowler, Edith Waldvogel Blumhofer, Fernando F Segovia, \u0027New paradigms for Bible study\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"What does the future \u0026amp;mdash; especially the future of \u0027\u0027cybermedia\u0027\u0027 \u0026amp;mdash; hold for academic biblical scholarship\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Nick Heil, \u0027Dark Summit: The True Story of Everest\u0027s Most Controversial Season\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Brice had developed a particularly contentious relationship with Everest\u0027s emerging \u0027\u0027cybermedia\u0027\u0027, specifically \u0027EverestNews.com\", \"priority\":9}]}, \"synonyms\":{}}");

