	add("cybernetics", "{\"term\":\"cybernetics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κυβερνητικός\u0027 (good at steering, good pilot) from \u0027κυβερνάω\u0027 (i steer, drive, guide, act as a pilot) possibly based on 1830s French \u0027cybernétique\u0027 \u0026quot;the art of governing.\u0026quot; The term was coined in 1948 by U.S. mathematician w:Norbert Wiener|Norbert Wiener.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory/science of communication and control in the animal and the machine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The art/study of governing, controlling automatic processes and communication\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Technology related to computers and Internet\", \"priority\":3}]}, \"synonyms\":{}}");

