	add("cyberphobia", "{\"term\":\"cyberphobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|cyber|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fear of computers and technolog\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027 Oct 3, Bruce E. Bergen, \u0027Increasing Proudctivity and Comfort\u0027, in \u0027New York Times\u0027, pAS2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Overcoming \u0027\u0027cyberphobia\u0027\u0027 is not easy, but any effort to automate professionals must address their resistance and concerns or be doomed to failure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, T. B. Barrier, \u0027Assessing the Role of Cyberphobia\u0027, in \u0027Managing Information Technology in a Global Society\u0027, p16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Past studies have been performed to investigate the phenomena \u0026lt;!-- sic --\u0026gt; of \u0027\u0027cyberphobia\u0027\u0027, to measure \u0027\u0027cyberphobia\u0027\u0027, and to examine the demographic and psychological variables related to \u0027\u0027cyberphobia\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Donald Hugh Parkerson \u0026amp; Jo Ann Parkerson, \u0027Transitions in American Education\u0027, p21\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Moreover most young people who have grown up with computers find this \u0027\u0027cyberphobia\u0027\u0027 difficult to understand\", \"priority\":7}]}, \"synonyms\":{}}");

