	add("cyberprostitution", "{\"term\":\"cyberprostitution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|prostitution|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Prostitution in cyberspace, i.e. cybersex performed for money or other favours\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Al Cooper, \u0027Sex and the Internet: a guidebook for clinicians\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There have been instances of forced participation by women in Internet-related sexual activities (eg, trading of women for \u0027\u0027cyberprostitution\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Michael Cross, Debra Littlejohn Shinder, \u0027Scene of the Cybercrime\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An interesting law enforcement issue is that of \u0027\u0027cyberprostitution\u0027\u0027, which involves trading virtual sex for money\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Andrea Millwood Hargrave, Sonia Livingstone, \u0027Harm and Offence in Media Content: A Review of the Evidence\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"how women and girls as individuals and as a group are harmed by online harassment, virtual rape, and \u0027\u0027cyberprostitution\", \"priority\":7}]}, \"synonyms\":{}}");

	add("cyberprotest", "{\"term\":\"cyberprotest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|protest|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protest expressed or organised by means of computer networks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Michael Erbschloe, \u0027Trojans, worms, and spyware\u0027 (page 175\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although the \u0027\u0027cyberprotests\u0027\u0027 seen today have already caused limited damage, the potential for future attacks could bring about large economic losses as well as potentially severe damage to the national infrastructure\", \"priority\":3}]}, \"synonyms\":{}}");

