	add("cyberscape", "{\"term\":\"cyberscape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|scape|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The virtual landscape of cyberspace; the face of computer networking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Margaret E Crahan, Alberto Vourvoulias-Bush, \u0027The city and the world: New York\u0027s global future\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Several factors are driving this transformation of New York City\u0027s \u0027\u0027cyberscape\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Kristine Blair, Pamela Takayoshi, \u0027Feminist cyberscapes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The contributors to this collection take up this challenge in mapping a feminist \u0027\u0027cyberscape\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, S Elizabeth Bird, \u0027The audience in everyday life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They warn each other about the dangers involved in anonymous chat rooms, and compare their community to the otherwise bleak \u0027\u0027cyberscape\", \"priority\":7}]}, \"synonyms\":{}}");

