	add("cybersquatting", "{\"term\":\"cybersquatting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|squatting|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The registration of a well-known brand or company name as an Internet domain name in the hope of selling it at a later dat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Jeff Kuester, \u0027re: They want to take scooby.com away!\u0027 [https://groups.google.com/d/msg/misc.int-property/xI71ETBPmaY/9iwZdg-ULFAJ], misc.int-property\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Maybe a little broad in your interpretation? Dilution would not have existed in this case if Toeppen were not in the \u0026quot;business\u0026quot; of \u0027\u0027cybersquatting\u0027\u0027? The statute does not allow noncommercial use to \u0026quot;dilute\u0026quot;, but when a domain name owner suggests money may be taken for the domain name, a problem is created for the DNO, right? This may be a large trap for attorneys advising in this area\", \"priority\":3}]}, \"synonyms\":{}}");

	add("cybersuit", "{\"term\":\"cybersuit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|suit|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical suit of clothing that augments the wearer\u0027s capabilities by means of computer technology\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Herbert Blau, \u0027Nothing in itself: complexions of fashion\u0027 (page 268\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The notion of a second skin may still be more seductive in the imagining than the reality, but on the utopian side of the \u0027Blade Runner\u0027 there is the prospect of \u0027\u0027cybersuits\u0027\u0027, made possible by petrochemical fabrics\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Douglas Mulhall, \u0027Our molecular future\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Just as these suits make cybersex possible, they let the physician poke and feel, using cybergloves on one end and the patient\u0027s \u0027\u0027cybersuit\u0027\u0027 responding on the other\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sam Fisher, \u0027E-FORCE: State of Emergency\u0027 (page 61\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was looking at a small flexible screen wrapped halfway around his forearm, meshed into the fabric of his \u0027\u0027cybersuit\", \"priority\":7}]}, \"synonyms\":{}}");

