	add("cybertown", "{\"term\":\"cybertown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|town|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The social equivalent of a town on the Internet or in cyberspace; an online community\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Michael Heim, \u0027Virtual Realism\u0027 (page 70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Unlike the many artificial worlds being built today on the Internet — including elaborate \u0027\u0027cybertowns\u0027\u0027 with \u0026quot;virtual\u0026quot; apartments — the PlaceHolder reinforces the sense of place with ambient 3-D sound and kinesthetic appropriation\", \"priority\":3}]}, \"synonyms\":{}}");

