	add("cyberviolence", "{\"term\":\"cyberviolence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|violence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Violence, or its equivalent, carried out in cyberspace or on the Internet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, David Wall, \u0027Crime and the Internet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At one end of the spectrum of \u0027\u0027cyberviolence\u0027\u0027 lies hate speech, which tends to impact upon specific social, political or religious groups\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Eugene McLaughlin, John Muncie, \u0027The Sage Dictionary of Criminology\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cybercrime often involves \u0027\u0027cyberviolence\u0027\u0027 that puts the personal safety of citizens at risk through, for example, the manipulation of the emotions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Eric W Hickey, \u0027Encyclopedia of Murder and Violent Crime\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At the core of rape, domestic violence, pedophilia, \u0027\u0027cyberviolence\u0027\u0027, and other interactions, one discovers precisely a way of being that is grounded in domination and reduces others simply to objects\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Janet Staiger, \u0027Media reception studies\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"threats of personal violence, actual acts of \u0027\u0027cyberviolence\u0027\u0027 (spamming those making the assertions\", \"priority\":9}]}, \"synonyms\":{}}");

