	add("cyberwarfare", "{\"term\":\"cyberwarfare\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|warfare|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Warfare taking place on the Internet, as by disrupting critical online services\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d6 April passage\u003dMany [computer attacks of Chinese origin] are believed to be linked to \u0027\u0027cyberwarfare\u0027\u0027 units of the People\u0027s Liberation Army acting on behalf of state-owned, or state-affiliated, Chinese companies\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cyberzine", "{\"term\":\"cyberzine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cyber|zine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magazine published on the Internet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Steven Heller, \u0027Design literacy (continued): understanding graphic design\u0027 (page 34\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Today, comparable \u0027\u0027cyberzines\u0027\u0027 reach tens of thousands of readers without incurring any printing or distribution costs. The only expenses, in addition to the hard- and software, are modest server and access fees\", \"priority\":3}]}, \"synonyms\":{}}");

